import Container from ''
import CustomCard from '../../Components/Components/CustomCard';
import './Landing.css';

class Landing extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <main className="container">
                <Container maxWidth="sm">
            <CustomCard />
            <CustomCard />
            <CustomCard />
            <CustomCard />
            <CustomCard />
                </Container>
            </main>
        );
    }
}

export default Landing;
